        Mesas.update(req.body,{where: req.params})
        .then (result => res.sendStatus(204))
        .catch(error => {
            res.status(412).json({msg: error.message});
        });
    })

    .delete((req, res) => {
        Mesas.destroy({where: req.params})
        .then (result => res.sendStatus(204))
